import React from "react";
import {
  Box,
  Flex,
  Text,
  Button,
  Stack,
  useColorMode,
  Image,
  HStack,
  Grid,
} from "@chakra-ui/react";
import { BiMenu } from "react-icons/bi";
import { AiOutlineClose } from "react-icons/ai";
import { ColorModeSwitcher } from "../ColorModeSwitcher";

// icon
import Bag from "../Image/Bag.png";
import User from "../Image/User.png";
import Menu from "../Image/Menu.png";
import Close from "../Image/Close.png";

// import { NavHashLink } from 'react-router-hash-link';

// https://github.com/dimitrisraptis96/chakra-ui-navbar/blob/main/src/components/Header.js
// https://raptis.wtf/freebies/color-pairs

function Navbar(props) {
  // eslint-disable-next-line
  const { colorMode, toggleColorMode } = useColorMode();
  const [isOpen, setIsOpen] = React.useState(false);

  const toggle = () => setIsOpen(!isOpen);

  return (
    <NavBarContainer
      {...props}
      bg={colorMode === "light" ? "bodyBackground" : ""}
    >
      <a href="/">
        <Text as="h2" fontWeight="500" fontSize="3xl">
          Logo
        </Text>
      </a>
      <HStack display="inline-flex" border="1px solid" alignItems={["flex-start"]}>
        <IconComponent />
        <MenuToggle toggle={toggle} isOpen={isOpen} />
      </HStack>
      <MenuLinks isOpen={isOpen} />
    </NavBarContainer>
  );
}

const MenuToggle = ({ toggle, isOpen }) => {
  return (
    <Box
      // display={{ base: "flex", md: "none" }}
      onClick={toggle}
      justifyContent={{ sm: "flex-end" }}
      border="1px solid"
    >
      {isOpen ? <AiOutlineClose size={40} /> : <BiMenu size={40} />}
    </Box>
  );
};

const MenuLinks = ({ isOpen }) => {
  return (
    <Box
      // display={{ base: isOpen ? "block" : "none", md: "block" }}
      display={{ base: isOpen ? "flex" : "none", md: "flex" }}
      // flexBasis={{ base: "100%", md: "auto" }}
    >
      <Stack
        spacing={8}
        align={["flex-end"]}
        justify={["center", "space-between", "space-between", "space-between"]}
        direction={["column", "row", "row", "row"]}
        pt={[4, 4, 0, 0]}
      >
        <a href="/">
          <Text display="block" fontWeight="500">
            Home
          </Text>
        </a>

        <a href="/#Products">
          <Text display="block" fontWeight="500">
            Products
          </Text>
        </a>

        <a href="/#Training">
          <Text display="block" fontWeight="500">
            {/* Training and Consultation */}
            Training
          </Text>
        </a>

        <a href="/#5s-Warm-Up">
          <Text display="block" fontWeight="500">
            5s Warm Up
          </Text>
        </a>

        {/* <ColorModeSwitcher /> */}
      </Stack>
    </Box>
  );
};

const IconComponent = () => {
  return (
    <>
      <Box>
        <HStack pt={["1"]} >
          <Image src={Bag} height="30px" width="auto" />
          <Image src={User} height="30px" width="auto" />
        </HStack>
      </Box>
    </>
  );
};

const NavBarContainer = ({ children, ...props }) => {
  return (
    // <Box
    //   display="flex"
    //   as="nav"
    //   align={["flex-start", "flex-start", "center", "center"]}
    //   justify="space-between"
    //   wrap="wrap"
    //   w="100%"
    //   p="1%"
    //   {...props}
    // >
    <Box
      // gridTemplateColumns={{
      //   sm: ".5fr .5fr",
      //   md: ".5fr 1fr .5fr ",
      //   lg: ".5fr 1fr .5fr",
      //   xl: ".5fr 1fr .5fr",
      // }}
      display={["flex"]}
      p="1%"
      w="100vw"
      alignItems={{ sm: "center", md: "center", lg: "center", xl: "center" }}
      justifyContent={["space-between"]}
      border="1px solid"
      {...props}
    >
      {children}
    </Box>
    // {/* </Box> */}
  );
};

export default Navbar;
